import React from "react";
import Navbar from "../Components/navbarComponent";
import GalleryCard from "../Components/galleryComponent";

// gallery page
function Gallery() {
  let imgData = [
    {
      id: "1",
      imgName: "Irene",
      img: "https://media.istockphoto.com/photos/global-connection-picture-id1335295270?b=1&k=20&m=1335295270&s=170667a&w=0&h=PNF6QH5FyD_XvDbn4nHtIVKdmmlN86fCHTgwvkZYvHA=",
      category: "",
      updatedAt: "2 days ago",
    },
    {
      id: "2",
      imgName: "Irene",
      img: "https://media.istockphoto.com/photos/global-connection-picture-id1335295270?b=1&k=20&m=1335295270&s=170667a&w=0&h=PNF6QH5FyD_XvDbn4nHtIVKdmmlN86fCHTgwvkZYvHA=",
      category: "",
      updatedAt: "2 days ago",
    },
    {
      id: "3",
      imgName: "Irene",
      img: "https://media.istockphoto.com/photos/global-connection-picture-id1335295270?b=1&k=20&m=1335295270&s=170667a&w=0&h=PNF6QH5FyD_XvDbn4nHtIVKdmmlN86fCHTgwvkZYvHA=",
      category: "",
      updatedAt: "2 days ago",
    }
  ];

  // declare initial states
  //const [userEmail, setUserEmail] = useState("");
  //const [password, setPassword] = useState("");

  // get all images
  const getAllImages = () => {
    fetch("http://127.0.0.1:3000/galleries", {
      method: "GET",
      //mode: "no-cors",
      headers: { "Content-Type": "application/json" }
    })
      .then((res) => {
        console.log(res.json());
        return res.json
      })
      .catch((err) => console.log(err));
  };

  // call function
  getAllImages();

  return (
    <div>
      <Navbar />

        {/* iterate over each and show in grid system */}
      <div className="row">
        {imgData.map(({ id, imgName, img, category, updatedAt }) => {
          return (
            <div key={id} className="col-md-4">
              <GalleryCard
                key={id}
                id={id}
                imgName={imgName}
                img={img}
                category={category}
                updatedAt={updatedAt}
              />
            </div>
          );
        })}
      </div>
    </div>
  );
}

export default Gallery;
